-- Creating and populating `suppliers`
CREATE TABLE `suppliers` (
    `supplierID` INT AUTO_INCREMENT PRIMARY KEY,
    `companyName` VARCHAR(255) NOT NULL UNIQUE,
    `contactName` VARCHAR(255),
    `contactTitle` VARCHAR(255)
) AS
SELECT DISTINCT
    `supplierID`,
    `suppliers_companyName` AS `companyName`,
    `suppliers_contactName` AS `contactName`,
    `suppliers_contactTitle` AS `contactTitle`
FROM (
    SELECT `supplierID`, `suppliers_companyName`, `suppliers_contactName`, `suppliers_contactTitle`,
           ROW_NUMBER() OVER (PARTITION BY `supplierID` ORDER BY `supplierID`) AS `row_num`
    FROM `project_data`
) AS deduped
WHERE `row_num` = 1;

-- Creating and populating `categories`
CREATE TABLE `categories` (
    `categoryID` INT AUTO_INCREMENT PRIMARY KEY,
    `categoryName` VARCHAR(255) NOT NULL UNIQUE
) AS
SELECT DISTINCT
    CAST(`categoryID` AS SIGNED) AS `categoryID`,
    CAST(`categoryName` AS CHAR(255)) AS `categoryName`
FROM `project_data`;

-- Creating and populating `order_details`
CREATE TABLE `order_details` (
    `orderDetailID` INT AUTO_INCREMENT PRIMARY KEY,
    `orderID` INT NOT NULL,
    `productID` INT NOT NULL,
    `quantity` INT NOT NULL CHECK (`quantity` > 0),
    `unitPrice` DECIMAL(6,2) NOT NULL CHECK (`unitPrice` >= 0),
    `discount` DECIMAL(4,2) CHECK (`discount` BETWEEN 0 AND 1),
    FOREIGN KEY (`orderID`) REFERENCES `orders`(`orderID`),
    FOREIGN KEY (`productID`) REFERENCES `products`(`productID`),
    UNIQUE (`orderID`, `productID`) -- Composite Key to prevent duplicate order-product pairs
);

INSERT INTO `order_details` (`orderID`, `productID`, `quantity`, `unitPrice`, `discount`)
SELECT DISTINCT
    `orderID`,
    `productID`,
    `quantity`,
    `unitPrice`,
    `discount`
FROM `project_data`;

-- Creating and populating `orders`
CREATE TABLE `orders` (
    `orderID` INT AUTO_INCREMENT PRIMARY KEY,
    `customerID` VARCHAR(10) NOT NULL,
    `employeeID` INT NOT NULL,
    `orderDate` DATE NOT NULL,
    `requiredDate` DATE,
    `shippedDate` DATE,
    `shipVia` INT DEFAULT 1,
    `freight` DECIMAL(8,2),
    FOREIGN KEY (`customerID`) REFERENCES `customers`(`customerID`),
    FOREIGN KEY (`employeeID`) REFERENCES `employees`(`employeeID`)
);

INSERT INTO `orders` (`orderID`, `customerID`, `employeeID`, `orderDate`, `requiredDate`, `shippedDate`, `shipVia`, `freight`)
SELECT DISTINCT
    `orderID`,
    `customerID`,
    `employeeID`,
    `orderDate`,
    `requiredDate`,
    `shippedDate`,
    `shipVia`,
    `freight`
FROM `project_data`;

-- Creating and populating `products`
CREATE TABLE `products` (
    `productID` INT AUTO_INCREMENT PRIMARY KEY,
    `productName` VARCHAR(255) NOT NULL UNIQUE,
    `supplierID` INT NOT NULL,
    `categoryID` INT NOT NULL,
    `quantityPerUnit` VARCHAR(100),
    `unitPrice` DECIMAL(6,2) NOT NULL CHECK (`unitPrice` >= 0),
    FOREIGN KEY (`supplierID`) REFERENCES `suppliers`(`supplierID`),
    FOREIGN KEY (`categoryID`) REFERENCES `categories`(`categoryID`)
);

INSERT INTO `products` (`productID`, `productName`, `supplierID`, `categoryID`, `quantityPerUnit`, `unitPrice`)
SELECT DISTINCT
    `productID`,
    `productName`,
    `supplierID`,
    `categoryID`,
    `quantityPerUnit`,
    `unitPrice`
FROM (
    SELECT `productID`, `productName`, `supplierID`, `categoryID`, `quantityPerUnit`, `unitPrice`,
           ROW_NUMBER() OVER (PARTITION BY `productID` ORDER BY `productID`) AS `row_num`
    FROM `project_data`
) AS deduped
WHERE `row_num` = 1;

-- Table: Customers
CREATE TABLE `customers` (
    `customerID` VARCHAR(10) PRIMARY KEY,
    `companyName` VARCHAR(100),
    `contactName` VARCHAR(40),
    `contactTitle` VARCHAR(40)
);

INSERT INTO `customers` (`customerID`, `companyName`, `contactName`, `contactTitle`)
SELECT DISTINCT 
    `customerID`, 
    `companyName`, 
    `contactName`, 
    `contactTitle`
FROM `project_data`
WHERE `customerID` IS NOT NULL;

-- Table: Employees
CREATE TABLE `employees` (
    `employeeID` INT AUTO_INCREMENT PRIMARY KEY,
    `lastName` VARCHAR(40) NOT NULL,
    `firstName` VARCHAR(40) NOT NULL,
    `title` VARCHAR(40)
);

INSERT INTO `employees` (`employeeID`, `lastName`, `firstName`, `title`)
SELECT DISTINCT 
    `employeeID`, 
    `employees_lastName` AS `lastName`, 
    `employees_firstName` AS `firstName`, 
    `employees_title` AS `title`
FROM `project_data`
WHERE `employeeID` IS NOT NULL;

